      cappedKeyAccessor (d, i) {
          if (d.others) {
              return d.key;
          }
          return this.keyAccessor()(d, i);
      }

      cappedValueAccessor (d, i) {
          if (d.others) {
              return d.value;
          }
          return this.valueAccessor()(d, i);
      }

